window.bookSummaryJSON = "<p>Michael is an impetuous and creative Tulpa who longs for adventure and excitement. Tired of playing second fiddle to his successful author John, Michael sets out on a journey to prove himself as a hero in his own right.</p> <p>When Michael discovers a secret room in John's subconscious mind, he becomes determined to uncover the truth about the young girl encapsulated in a memory engram. With the help of Charlie, the first Tulpa created by John, Michael must navigate the dangerous and unpredictable world of John's unconscious mind, the Dark Zone.</p> <p>Together, Michael and Charlie must face monsters and demons, learn new spells, and confront their limitations and preconceptions. But with the ruthless and amoral librarian Alexa, another Tulpa created by John, determined to stop them and protect her secrets, the stakes are higher than ever.</p> <p>In a thrilling climax, Michael and Alexa engage in a gripping confrontation that will determine the fate of his friends, the library, and Michael's own future.&nbsp;</p> <p><i>Tulpamancer: Edge of Chaos</i> is a unique and engaging journey that explores the world of Tulpas and the power of the subconscious mind. Based on a true story, this book is a perfect blend of fantasy, action, and mystery that will keep listeners on the edge of their seats.</p>"; 
